script: |
  super -f text -I q4835.spq | sort > q4835.out

inputs:
  - name: q4835.spq
    data: |
      SELECT COUNT ( * ) AS col0 FROM tab0 (FORMAT parquet) AS cor0 LEFT OUTER JOIN tab1 (FORMAT parquet) AS cor1 ON NOT + ( + 9 ) IS NOT NULL WHERE + + 75 IS NOT NULL;
  - name: tab0
  - name: tab1

outputs:
  - name: q4835.out
    data: |
      3
